  false,\n\t\"url\": null,\n\t\"notes\": \"Marine seismic reflection data are used
  to image and map sedimentary and structural features of the seafloor and subsurface.
  These data are useful in mapping stratigraphy and in assessing other submarine geologic
  characteristics and features. The data presented here are useful in mapping sand
  deposits that may be used in Louisiana beach nourishment projects. These data were
  collected as part of a Louisiana Sand Resources Study done in cooperation between
  the USGS, U.S. Army Corps of Engineers, University of New Orleans, Louisiana Department
  of Natural Resources, and Eckerd College. This study is part of the USGS Subsidence
  and Coastal Change (SCC) Project.\",\n\t\"license_title\": null,\n\t\"extras\":
